import React from "react";
import "../styles/Home.css";
import RingsImage from "../images/wedding-ring.png";

const Home = () => {
  return (
    <div className="home">
      <div className="rectangle-background">
        <div className="date-and-icon">
          <img src={RingsImage} />
          <span className="home-date">07|05|22</span>
        </div>
        <div className="title">
          <h2>Lucila</h2>
          <span className="middle-title">&</span>
          <h2>Luciano</h2>
        </div>
        <div className="quote">
          <p>
            "Y mis ojos, versus su sonrisa, <br /> terminaron por tirar la
            fachada"
          </p>
        </div>
      </div>
    </div>
  );
};

export default Home;
